CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_portal_myitem` AS select `portal_myitem`.`ROWGUID` AS `myrowguid`,`portal_myitem`.`USERGUID` AS `userguid`,`portal_item`.`INITROW` AS `initrow`,`portal_item`.`INITCOL` AS `initcol`,`portal_item`.`rowspan` AS `rowspan`,`portal_item`.`colspan` AS `colspan`,`portal_item`.`belongportalguid` AS `belongportalguid`,`portal_item`.`TITLE` AS `title`,`portal_item`.`ROWGUID` AS `rowguid`,`portal_myitem`.`ITEMCOL` AS `itemcol`,`portal_myitem`.`ITEMROW` AS `itemrow`,`portal_myitem`.`rowspan` AS `itemrowspan`,`portal_myitem`.`colspan` AS `itemcolspan`,`portal_myitem`.`disabled` AS `disabled`,`portal_item`.`url` AS `url` from (`portal_item` join `portal_myitem` on((`portal_item`.`ROWGUID` = `portal_myitem`.`PORTALETGUID`))) where (`portal_item`.`DISABLED` = 0) ;

-- ----------------------------
-- View structure for view_subscribed_api
-- ----------------------------
DROP VIEW IF EXISTS `view_subscribed_api`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_subscribed_api` AS select `b`.`apiguid` AS `apiguid`,`b`.`categoryid` AS `categoryid`,`b`.`status` AS `status`,`b`.`description` AS `description`,`b`.`apiname` AS `apiname`,`a`.`isenable` AS `isenable`,`a`.`refuse` AS `refuse`,`a`.`appguid` AS `appguid`,`a`.`rowguid` AS `rowguid` from (`api_subscribe` `a` join `api_info` `b` on((`a`.`apiguid` = convert(`b`.`RowGuid` using utf8mb4)))) ;

