-- ----------------------------
-- Function structure for ConvertGuid
-- ----------------------------
DROP FUNCTION IF EXISTS `ConvertGuid`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `ConvertGuid`(  newGuid varchar(50),  INSTR varchar(50)) RETURNS varchar(50) CHARSET utf8mb4
begin
	DECLARE workStr varchar(100);
	set workStr = '';
	IF( newGuid is null) THEN
	set workStr='';
	END IF;
	IF( LENGTH(RTRIM(INSTR)) <= 12) THEN
	set workStr =  substr(newGuid, char_length(RTRIM(newGuid)) - 11, char_length(RTRIM(INSTR)));
	ELSE
	set workStr =  CONCAT(SUBSTR(newGuid, 1, char_length(RTRIM(newGuid)) - 12),SUBSTR(INSTR, char_length(RTRIM(INSTR)) - 11, 12));
	END IF;
	return workStr;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fun_getPY
-- ----------------------------
DROP FUNCTION IF EXISTS `fun_getPY`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fun_getPY`(in_string VARCHAR(200)) RETURNS varchar(200) CHARSET utf8mb4
BEGIN
	
DECLARE tmp_str VARCHAR(200) CHARSET gbk DEFAULT ''; 
	
DECLARE tmp_len SMALLINT DEFAULT 0;
	
DECLARE tmp_loc SMALLINT DEFAULT 0;
	
DECLARE tmp_char VARCHAR(2) CHARSET gbk DEFAULT '';
	
DECLARE tmp_rs VARCHAR(200)CHARSET gbk DEFAULT '';
	
DECLARE tmp_cc VARCHAR(2) CHARSET gbk DEFAULT '';
	
	SET tmp_str = in_string;
	
SET tmp_len = LENGTH(tmp_str);
	
	WHILE tmp_len > 0 DO 
	
SET tmp_char = LEFT(tmp_str,1);
	
SET tmp_cc = tmp_char;
	
SET tmp_loc=INTERVAL(CONV(HEX(tmp_char),16,10),0xB0A1,0xB0C5,0xB2C1,0xB4EE,0xB6EA,0xB7A2,0xB8C1,0xB9FE,0xBBF7,0xBFA6,0xC0AC
	,0xC2E8,0xC4C3,0xC5B6,0xC5BE,0xC6DA,0xC8BB,0xC8F6,0xCBFA,0xCDDA ,0xCEF4,0xD1B9,0xD4D1);
	
IF (LENGTH(tmp_char)>1 AND tmp_loc>0 AND tmp_loc<24) THEN
	
SELECT ELT(tmp_loc,'A','B','C','D','E','F','G','H','J','K','L','M','N','O','P','Q','R','S','T','W','X','Y','Z') INTO tmp_cc; 
	END IF;
	IF ASCII(tmp_cc)>64 AND ASCII(tmp_cc) <91
	THEN
	
SET tmp_rs = CONCAT(tmp_rs,tmp_cc);
	END IF;
	
SET tmp_str = SUBSTRING(tmp_str,2);
	
SET tmp_len = LENGTH(tmp_str);
	END WHILE;
	
RETURN tmp_rs;
	END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getChildOuList
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildOuList`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getChildOuList`(rootId VARCHAR(50)) RETURNS longtext CHARSET utf8mb4
BEGIN
	DECLARE sTemp longtext;
	DECLARE sTempChd longtext;
	SET@@group_concat_max_len = 102400;
	SET sTemp = '$';
	SET sTempChd = rootId;
WHILE sTempChd IS NOT NULL DO
	SET sTemp = concat(sTemp, ',', sTempChd);
	SELECT group_concat(ouguid) INTO sTempChd FROM frame_ou
	WHERE FIND_IN_SET(parentouguid, sTempChd) > 0;
END
WHILE;
	SET@@group_concat_max_len = 1024;
RETURN SUBSTRING(sTemp, 3);
END
;;
DELIMITER ;